INSERT INTO `About` VALUES (7,11,'2025-04-20','Pedal Points','We have developed a web application designed to revolutionize the trucking industry by incentivizing better on-road performance. \nOur platform enables sponsors to reward positive driving behaviors and discourage unsafe practices through a point-based system, similar to a loyalty rewards program. \nThis allows companies to promote safer, more efficient driving while truckers earn valuable rewards.\n\nOur business model operates on a performance-based system, where you will earn a percentage of total sales generated once the platform is live. \nWith expertise in Python, Flask, MySQL, and AWS deployment, we have built a secure, scalable, and reliable platform tailored for the trucking industry.\n\nDrivers can create an account and apply for sponsorship. Once their application has been approved, they are able to view their sponsor’s catalog, add items to their cart, and purchase items using their points for each sponsor company they are affiliated with. \nThey can view a complete history of their points—including transactions, redemptions, and adjustments—as well as track the status of their sponsorship applications. \nDrivers also receive notifications sent by admins, which they can view directly from their profiles.\n\nSponsors can create accounts for other sponsor users or drivers, review and manage applications by accepting or rejecting them, \nremove or reinstate drivers in their organization, and set response time frames for applications. \nSponsors can also add items to their organization\'s catalog.\n\nIn addition to these capabilities, sponsors are also able to edit any information related to drivers or other sponsors within their organization. \nThey can manage the points system by setting the point value, adding or deducting points for individual drivers or groups, and even making purchases on a driver’s behalf. \nSponsors have access to detailed reports about user logins, commissions, applications, and point activity for all users within their organization. \nThey also receive notifications issued by admins within their profile.\n\nAdmins have full platform control. They can create accounts for other admins, sponsors, and drivers, as well as add new sponsor organizations. \nAdmins can edit or deactivate any user account, assign drivers to specific sponsor organizations, and access reports related to logins, commissions, applications, and points for all users across the platform. \nIn addition to these functionalities, admins can send notifications to all sponsors, all drivers, or to specific sponsors or drivers, helping facilitate important platform-wide announcements or targeted updates.\n\nAll users can log in, view their profiles, and edit their personal information, including their username and password. \nBy streamlining the rewards process and enhancing safety incentives, our platform is set to drive positive change in the trucking industry.');
